import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar';
import LandingPage from './pages/LandingPage';
import RestaurantResults from './pages/RestaurantResults';
import { Login, Signup } from './pages/auth/AuthPages';
import Profile from './pages/Profile';
import Favorites from './pages/Favorites';
import Settings from './pages/Settings';
import './App.css';

function App() {
  const [mapsLoaded, setMapsLoaded] = useState(false);
  const [mapsError, setMapsError] = useState(null);

  useEffect(() => {
    const loadGoogleMaps = () => {
      const script = document.createElement('script');
      script.src = `https://maps.googleapis.com/maps/api/js?key=${process.env.REACT_APP_GOOGLE_MAPS_API_KEY}&libraries=places`;
      script.async = true;
      script.defer = true;

      script.addEventListener('load', () => {
        setMapsLoaded(true);
      });

      script.addEventListener('error', () => {
        setMapsError('Failed to load Google Maps');
      });

      document.head.appendChild(script);
    };

    loadGoogleMaps();
  }, []);

  if (mapsError) {
    return <div className="error-message">Failed to load Google Maps. Please refresh the page.</div>;
  }

  return (
    <Router>
      <div className="app">
        <Navbar />
        <main className="main-content">
          <Routes>
            <Route path="/" element={<LandingPage mapsLoaded={mapsLoaded} />} />
            <Route path="/restaurants" element={<RestaurantResults mapsLoaded={mapsLoaded} />} />
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<Signup />} />
            <Route path="/profile" element={<Profile />} />
            <Route path="/favorites" element={<Favorites />} />
            <Route path="/settings" element={<Settings />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
